// src/components/Navbar.js
import React from 'react';
import { AppBar, Toolbar, Typography, Button, Container } from '@mui/material';
import { Link } from 'react-router-dom';
import logo from '../assets/LogoPrincipal.png'; // Asegúrate de que la ruta del logo sea correcta

const Navbar = () => {
    return (
        <AppBar position="static" style={{ backgroundColor: '#3f51b5' }}>
            <Container maxWidth="lg">
                <Toolbar>
                    {/* Logo */}
                    <img src={logo} alt="Logo" style={{ width: '50px', marginRight: '20px' }} />

                    {/* Títulos y enlaces */}
                    <Typography variant="h6" style={{ flexGrow: 1 }}>
                        Mi Aplicación
                    </Typography>
                    <Button component={Link} to="/" color="inherit">Inicio</Button>
                    <Button component={Link} to="/about" color="inherit">Sobre Nosotros</Button>
                    <Button component={Link} to="/contact" color="inherit">Contacto</Button>
                    <Button component={Link} to="/logout" color="inherit">Cerrar Sesión</Button>
                </Toolbar>
            </Container>
        </AppBar>
    );
};

export default Navbar;
